import React, { useState } from 'react';
import "../styles/Search.css";
import { Link } from 'react-router-dom';
import HomeFooter from '../components/HomeFooter';
import DoctorForApproval from '../components/DoctorsForApproval';
import Popup from '../components/Popup'

function AdminHome() {
  const [message, setMessage] = useState('');
  const [isPopupVisible, setPopupVisibility] = useState(false);

  const handleLogout = async () => {
    try {
        const response = await fetch("http://localhost:8080/doctorlogout", {
        method: 'POST',
        });

        if (response.status === 200) {
        setMessage('Logged out successfully');
        window.location.href = '/patlogin';
        } else if (response.status === 401) {
        setMessage('No user is currently logged in');
        } else {
        setMessage('An error occurred');
        }
    } catch (error) {
        setMessage('An error occurred');
    }
  };
  // Sample doctor data (you can replace it with your own data)
  const doctors = [
    {
      firstName: 'Dr. John Cruz',
      specialization: 'Cardiologist',
      credentials: 'MD, FACC',
      profilePicture: 'doctor1.jpg',
    },
    {
      firstName: 'Dr. Jane Smith',
      specialization: 'Dermatologist',
      credentials: 'MD, FAAD',
      profilePicture: 'doctor2.jpg',
    },
    {
        firstName: 'Dr. David Johnson',
        specialization: 'Pediatrician',
        credentials: 'MD, FAAP',
        profilePicture: 'doctor3.jpg',
      },
      {
        firstName: 'Dr. Sarah Brown',
        specialization: 'Oncologist',
        credentials: 'MD, FACP',
        profilePicture: 'doctor4.jpg',
      },
      {
        firstName: 'Dr. Michael Williams',
        specialization: 'Orthopedic Surgeon',
        credentials: 'MD, FAAOS',
        profilePicture: 'doctor5.jpg',
      },
      {
        firstName: 'Dr. Emily Wilson',
        specialization: 'Gynecologist',
        credentials: 'MD, FACOG',
        profilePicture: 'doctor6.jpg',
      },
      {
        firstName: 'Dr. Robert Lee',
        specialization: 'Neurologist',
        credentials: 'MD, FAAN',
        profilePicture: 'doctor7.jpg',
      },
      {
        firstName: 'Dr. Maria Garcia',
        specialization: 'Endocrinologist',
        credentials: 'MD, FACE',
        profilePicture: 'doctor8.jpg',
      },
      {
        firstName: 'Dr. William Taylor',
        specialization: 'Dentist',
        credentials: 'DMD',
        profilePicture: 'doctor9.jpg',
      },
      {
        firstName: 'Dr. Jessica Anderson',
        specialization: 'Psychiatrist',
        credentials: 'MD, FAPA',
        profilePicture: 'doctor10.jpg',
      },
  ];

  const closePopup = () => {
    // Close the popup
    setPopupVisibility(false);
  };

  const handleReview = (doctor) => {
    setPopupVisibility(true);
  };

  return (
    <div className="search-container" id="container">
        <div id="navbar">
        <nav>
            <ul>
                <li style={{ float: 'left' }}>
                    <Link to="/">
                    <img
                    src={require('../images/DOC LOGO.png')}
                    alt="Doc Click Connect"
                    style={{ maxWidth: '100px', maxHeight: '40px', marginRight: '20px', marginLeft: '-50px' }}
                    /></Link>
                </li>
                <li style={{ float: 'right' }}>
                <button onClick={handleLogout}>Log Out</button>
                <p>{message}</p>
              </li>
            </ul>
        </nav>
    </div>
    <div style={{ display: "block", width: "100%", marginTop: "10%"}}>
          <h1 style={{textAlign: "center"}}>Doctor Profiles to Review</h1>
          <div className="doctor-grid" style={{marginLeft: "7%"}}>
            {doctors.map((doctor, index) => (
              <DoctorForApproval 
                key={index} 
                doctor={doctor} 
                onReview={handleReview}/>
            ))}
          </div>
      </div>
      <HomeFooter />

    {/* Popup */}
    <Popup trigger={isPopupVisible}>
            <form action="#" id="signin-form">
              <div>
                <h1 style={{float: "left", marginRight: "225px"}}>Doctor Details</h1>
                <h1 style={{float: "right", fontSize: "25px", color: "gray", cursor: "pointer"}} onClick={closePopup}>x</h1>
              </div>
              <div className="infield" style={{overflowY: 'auto', maxHeight: '500px' }}>
                <div>
                  <img src={require('../images/profilepic.jpg')} alt='profile' style={{float:"left", marginRight:"5%", width:"120px"}}/>
                </div>
                <div>
                  <h3>Doctor Name</h3>
                  <input type="text" name="docName" placeholder="Doctor Name" style={{width: "325px", marginBottom: "10px", padding: "15px"}} readOnly></input>
                </div>
                <div>
                  <h3>Doctor Credentials</h3>
                  <input type="text" name="credentials" placeholder="Doctor Credentials" style={{width: "325px", marginBottom: "10px", padding: "15px"}} readOnly></input>
                </div>
                <div>
                  <h3>Specialization</h3>
                  <input type="text" name="specialization" placeholder="Specialization" style={{padding: "15px"}} readOnly></input>
                </div>
                <div>
                  <h3>Email Address</h3>
                  <input type="text" name="emailAddress" placeholder="Email Address" style={{padding: "15px"}} readOnly></input>
                </div>
                <div>
                  <h3>Contact Number</h3>
                  <input type="text" name="contactNumber" placeholder="Contact Number" style={{padding: "15px"}} readOnly></input>
                </div>
                <div>
                  <h3>Clinic or Hospital Affiliation</h3>
                  <input type="text" name="clinicName" placeholder="Clinic or Hospital Affiliation" style={{padding: "15px"}} readOnly></input>
                </div>
                <div>
                  <h3>Clinic Schedule</h3>
                  <input type="text" name="clinicSched" placeholder="Clinic Schedule" style={{padding: "15px"}} readOnly></input>
                </div>
                <button style={{padding: 5, borderRadius: 0, width: "48.8%", textAlign: "center", marginTop: "20px", height: "40px", marginRight: "10px"}}>Approve Profile</button>
                <button className='cancel' style={{padding: 5, borderRadius: 0, width: "48.9%", textAlign: "center", marginTop: "20px", height: "40px"}}>Reject Profile</button>
              </div>
            </form>
          </Popup>
    </div>
  );
}

export default AdminHome;
